import React from 'react'
import Widget from '../Widget/Widget'
import './Container.css'
export default function Container({list,celciusAsUnit}) {
    return (
        <section id="container">
            <div id='currentStats'>
            <div id="left"></div>
            <div id="right"></div>
            </div>
            <div id='widgets'>
           {    list.forecastDays
                    .map((item) =>
                            <Widget key = {Math.random()} datetime={item.date} daysummary={item.day_summary} alt="" celciusAsUnit={celciusAsUnit}>
                            </Widget>
           )}
           </div>
        </section>
    )
}
